import React from 'react'
import {Route , Switch} from 'react-router-dom';
import Login from './Login';
import Chat from './Chat';
import ListContact from './ListContact';
import AddContact from './AddContact';
import Menu from './Menu';
import {Forget,OtpPage} from './Login';

const App=()=> {
  const Error=()=>`Opps! page not Found :🐍`
  return(<>
        <Menu/>
      <Switch>
        <Route exact path ='/login' component ={Login} />
        <Route exact path ='/chat' component ={Chat} />
        <Route exact path ='/listcontact' component ={ListContact} />
        <Route exact path ='/addcontact' component ={AddContact} />
        <Route excat path ='/forgetpassword' component = {Forget}/>
        <Route excat path ='/forgetpassword/otppage' component = {OtpPage}/>
        <Route component= {Error}/>

      </Switch>
  </>)
}

export default App;
